import {makeStyles} from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    appBar: {
        backgroundColor: '#684a98',
        align: 'center',
        justifyContent: 'space-between'
      },
      icon: {
        marginRight: '10px',
      },
      logo: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }
}));

export default useStyles;
